using System;
using System.Linq;
using Shouldly;
using System.Threading.Tasks;
using Volo.Abp.Domain.Repositories;
using Xunit;

namespace Resume.ResumeSkills
{
    public class ResumeSkillsAppServiceTests : ResumeApplicationTestBase
    {
        private readonly IResumeSkillsAppService _resumeSkillsAppService;
        private readonly IRepository<ResumeSkill, Guid> _resumeSkillRepository;

        public ResumeSkillsAppServiceTests()
        {
            _resumeSkillsAppService = GetRequiredService<IResumeSkillsAppService>();
            _resumeSkillRepository = GetRequiredService<IRepository<ResumeSkill, Guid>>();
        }

        [Fact]
        public async Task GetListAsync()
        {
            // Act
            var result = await _resumeSkillsAppService.GetListAsync(new GetResumeSkillsInput());

            // Assert
            result.TotalCount.ShouldBe(2);
            result.Items.Count.ShouldBe(2);
            result.Items.Any(x => x.Id == Guid.Parse("c29284d3-75f4-4210-9f97-4234bcd881d1")).ShouldBe(true);
            result.Items.Any(x => x.Id == Guid.Parse("eb7208e9-26ac-4b48-a3e7-cd43e41be2df")).ShouldBe(true);
        }

        [Fact]
        public async Task GetAsync()
        {
            // Act
            var result = await _resumeSkillsAppService.GetAsync(Guid.Parse("c29284d3-75f4-4210-9f97-4234bcd881d1"));

            // Assert
            result.ShouldNotBeNull();
            result.Id.ShouldBe(Guid.Parse("c29284d3-75f4-4210-9f97-4234bcd881d1"));
        }

        [Fact]
        public async Task CreateAsync()
        {
            // Arrange
            var input = new ResumeSkillCreateDto
            {
                ResumeMainId = Guid.Parse("111888ef-a6ad-461a-a0f2-8e666759d292"),
                ComputerSkills = "",
                ComputerSkillsEtc = "",
                ChineseTypingSpeed = 1651528730,
                ChineseTypingCode = "a6843bee35124a5a95c6b41a53290ea0cc0040d6c5f347d3ba",
                EnglishTypingSpeed = 8810061,
                ProfessionalLicense = "",
                ProfessionalLicenseEtc = "",
                WorkSkills = "",
                WorkSkillsEtc = "",
                ExtendedInformation = "",
                DateA = new DateTime(2004, 6, 6),
                DateD = new DateTime(2010, 3, 22),
                Sort = 1604072250,
                Note = "",
                Status = "cb03e898eda94e359353061f0b07ff77acae5c17acdb46ec9a"
            };

            // Act
            var serviceResult = await _resumeSkillsAppService.CreateAsync(input);

            // Assert
            var result = await _resumeSkillRepository.FindAsync(c => c.Id == serviceResult.Id);

            result.ShouldNotBe(null);
            result.ResumeMainId.ShouldBe(Guid.Parse("111888ef-a6ad-461a-a0f2-8e666759d292"));
            result.ComputerSkills.ShouldBe("");
            result.ComputerSkillsEtc.ShouldBe("");
            result.ChineseTypingSpeed.ShouldBe(1651528730);
            result.ChineseTypingCode.ShouldBe("a6843bee35124a5a95c6b41a53290ea0cc0040d6c5f347d3ba");
            result.EnglishTypingSpeed.ShouldBe(8810061);
            result.ProfessionalLicense.ShouldBe("");
            result.ProfessionalLicenseEtc.ShouldBe("");
            result.WorkSkills.ShouldBe("");
            result.WorkSkillsEtc.ShouldBe("");
            result.ExtendedInformation.ShouldBe("");
            result.DateA.ShouldBe(new DateTime(2004, 6, 6));
            result.DateD.ShouldBe(new DateTime(2010, 3, 22));
            result.Sort.ShouldBe(1604072250);
            result.Note.ShouldBe("");
            result.Status.ShouldBe("cb03e898eda94e359353061f0b07ff77acae5c17acdb46ec9a");
        }

        [Fact]
        public async Task UpdateAsync()
        {
            // Arrange
            var input = new ResumeSkillUpdateDto()
            {
                ResumeMainId = Guid.Parse("4c8d0386-4a89-41fa-86b6-7339b90d9b01"),
                ComputerSkills = "",
                ComputerSkillsEtc = "",
                ChineseTypingSpeed = 2034258273,
                ChineseTypingCode = "3898d92d0d2e460c9118332cd84bfe2268671c65797c4bd887",
                EnglishTypingSpeed = 1070994294,
                ProfessionalLicense = "",
                ProfessionalLicenseEtc = "",
                WorkSkills = "",
                WorkSkillsEtc = "",
                ExtendedInformation = "",
                DateA = new DateTime(2010, 6, 19),
                DateD = new DateTime(2002, 6, 17),
                Sort = 703554837,
                Note = "",
                Status = "107368613a4941e3ab2aa544ba6a84ca2bd5778630b44a62a1"
            };

            // Act
            var serviceResult = await _resumeSkillsAppService.UpdateAsync(Guid.Parse("c29284d3-75f4-4210-9f97-4234bcd881d1"), input);

            // Assert
            var result = await _resumeSkillRepository.FindAsync(c => c.Id == serviceResult.Id);

            result.ShouldNotBe(null);
            result.ResumeMainId.ShouldBe(Guid.Parse("4c8d0386-4a89-41fa-86b6-7339b90d9b01"));
            result.ComputerSkills.ShouldBe("");
            result.ComputerSkillsEtc.ShouldBe("");
            result.ChineseTypingSpeed.ShouldBe(2034258273);
            result.ChineseTypingCode.ShouldBe("3898d92d0d2e460c9118332cd84bfe2268671c65797c4bd887");
            result.EnglishTypingSpeed.ShouldBe(1070994294);
            result.ProfessionalLicense.ShouldBe("");
            result.ProfessionalLicenseEtc.ShouldBe("");
            result.WorkSkills.ShouldBe("");
            result.WorkSkillsEtc.ShouldBe("");
            result.ExtendedInformation.ShouldBe("");
            result.DateA.ShouldBe(new DateTime(2010, 6, 19));
            result.DateD.ShouldBe(new DateTime(2002, 6, 17));
            result.Sort.ShouldBe(703554837);
            result.Note.ShouldBe("");
            result.Status.ShouldBe("107368613a4941e3ab2aa544ba6a84ca2bd5778630b44a62a1");
        }

        [Fact]
        public async Task DeleteAsync()
        {
            // Act
            await _resumeSkillsAppService.DeleteAsync(Guid.Parse("c29284d3-75f4-4210-9f97-4234bcd881d1"));

            // Assert
            var result = await _resumeSkillRepository.FindAsync(c => c.Id == Guid.Parse("c29284d3-75f4-4210-9f97-4234bcd881d1"));

            result.ShouldBeNull();
        }
    }
}